tables.table_schema:
CREATE TABLE quantum_results (
    experiment_id SERIAL PRIMARY KEY,
    experiment_name VARCHAR(100),
    measurement_time TIMESTAMP,
    measurement_result FLOAT
);

CREATE TABLE experiment_results (
  experiment_id INT PRIMARY KEY,
  experiment_name VARCHAR(255),
  experimental_data JSONB
);

CREATE TABLE quantum_analysis_results (
    analysis_id INT PRIMARY KEY,
    experiment_id INT,
    analysis_date DATE,
    analysis_result TEXT
);

CREATE TABLE experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(255) NOT NULL,
    experiment_date DATE
);

CREATE TABLE scientists (
    scientist_id INT PRIMARY KEY,
    scientist_name VARCHAR(255) NOT NULL
);

CREATE TABLE experiment_results (
    id INT PRIMARY KEY,
    experiment_name VARCHAR(255),
    measurement_time TIMESTAMP,
    result_value DECIMAL
);

CREATE TABLE experiment_responses (
    id INT PRIMARY KEY,
    result_id INT REFERENCES experiment_results(id),
    respondent_name VARCHAR(255),
    response VARCHAR(1000)
);

CREATE TABLE experiment_parameters (
    id INT PRIMARY KEY,
    parameter_name VARCHAR(255),
    parameter_value DECIMAL
);

CREATE TABLE experiment_participants (
    id INT PRIMARY KEY,
    participant_name VARCHAR(255),
    contact_email VARCHAR(255)
);
